import React from 'react';

const styles =[
    'btn--primary',
    'btn--outline'
]
const sizes =[
    'btn--medium',
    'btn--large'
]
const Button = ({children , type, onClick , buttonStyle , buttonSize}) => {

    const checkButtonStyle = styles.includes(buttonStyle) ? buttonStyle : styles[0]
    const checkButtonSSize = sizes.includes(buttonSize) ? buttonSize : styles[0]
    return (
        <div>
            <button className={`btn $ {checkButtonStyle} $ {checkButtonSSize}`} onClick={onClick} type={type}>
                {children}
            </button>
        </div>
    );
};

export default Button;
